import React from 'react';
import './css/style.css'
import './lib/bootstrap/css/bootstrap.min.css';
import './lib/font-awesome/css/font-awesome.min.css'
import './lib/animate/animate.min.css'
import './lib/ionicons/css/ionicons.min.css'
import './lib/owlcarousel/assets/owl.carousel.min.css'
import './lib/lightbox/css/lightbox.min.css'
import logo from './img/logo.png';
import {
    Routes,
    Route,
    Outlet,
    Link,
    useSearchParams,
    useParams
  } from "react-router-dom";


import {api} from './components/impl/api';
import { SiteContent } from './components/site/site';
  

function App() {
 return(
  <Routes>
    <Route path="/" element={<Layout/>}>
      
    </Route>
  </Routes>
 );
}


function Layout()
{
  let Menus : SiteContent.Menu[] = new api().createMenu();
  alert(Menus);
  return (
    
    <div >
      <header id="header" className="fixed-top">
    <div className="container">

      <div className="logo float-left">
        <a href="#intro" className="scrollto"><img src={logo} alt="" className="img-fluid"></img></a>
      </div>

      <nav className="main-nav float-right d-none d-lg-block">
        <ul>
          
            {/* {Menus.map(menu =>(
              <li> {menu} </li>
            ))}
           */}
          <li className="active"><a href="#intro">Home</a></li>
          <li><a href="#about">About Us</a></li>
          <li><a href="#services">Services</a></li>
          <li><a href="#portfolio">Portfolio</a></li>
          <li><a href="#team">Team</a></li>
          <li className="drop-down"><a href="">Drop Down</a>
            <ul>
              <li><a href="#">Drop Down 1</a></li>
              <li className="drop-down"><a href="#">Drop Down 2</a>
                <ul>
                  <li><a href="#">Deep Drop Down 1</a></li>
                  <li><a href="#">Deep Drop Down 2</a></li>
                  <li><a href="#">Deep Drop Down 3</a></li>
                  <li><a href="#">Deep Drop Down 4</a></li>
                  <li><a href="#">Deep Drop Down 5</a></li>
                </ul>
              </li>
              <li><a href="#">Drop Down 3</a></li>
              <li><a href="#">Drop Down 4</a></li>
              <li><a href="#">Drop Down 5</a></li>
            </ul>
          </li>
          <li><a href="#contact">Contact Us</a></li>
        </ul>
      </nav>
      
    </div>
  </header>
  <Outlet/>
    </div>
  );
}

export default App;
